import React from 'react';

const Contact = () => {
    return (
        <div>
            <h4>Abhijit Adhav</h4>
            <p>7768974237</p>
            <h4>Siddhesh Chavan</h4>
            <p>7276183864</p>
            <p>Email Id: learncode@info.com</p>
        </div>
    );
}

export default Contact;
